import React from 'react'
import Header from './Header';
import Footer from './Footer';
import Navigation from './Navigation';
import img1 from '../images/airplane.png'
import img2 from '../images/Transportation.png'
import img3 from '../images/parcel.png'
import img4 from '../images/map.png'




function Welcome() {
  return (
    <div className="welcome" style={{
      backgroundSize: 'cover',
      backgroundImage: `url(${img1})`
    }}>  
      <Header name =" AWFD">
        <h3>(Airways Fast Delivery)</h3>
      </Header>
      <Navigation/>


      <Footer/>
      <img src={img2} alt='transport'/>
      <img src={img3} alt='parcel'/>
      <img src={img4} alt='map'/>
    </div>
  )
}

export default Welcome
